import React, { Component } from 'react';
import './App.css';
import Todos from './components/Todos';


class App extends Component {
  state = {
    todos: [
      {
        id : 1,
        title : 'Take Out the trash',
        completed : false,
      },
      {
        id : 2,
        title : 'Take Out the trash',
        completed : false,
      },
      {
        id : 3,
        title : 'Dinner at home',
        completed : false,
      },
      {
        id : 4,
        title : 'New Learning On React',
        completed : false,
      },
    ]
  }

  render() {
    return (
      <div className="App">
        <Todos/>
      </div>
    );
  }
}

export default App;
